import React, { useState } from "react";
import { Text, TextInput, Image, TouchableOpacity, StyleSheet, View } from "react-native";
import Buttons from "../componets/Buttons";
import Input from "../componets/Input";
import { avatars } from "../Supports/avatar";
import pic from '../../assets/flower.jpg';

const Signup = (props) => {
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [phoneNumber, setPhoneNumber] = useState('');
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');
    const [avatar, setAvatar] = useState(avatars[0].image.asset.url);
   
    return (
        <View style={styles.container}>
            <Image source={pic} style={styles.backgroundImage} resizeMode="cover" />
            <Text style={styles.title}>Sign up</Text>
            <View>
                <TouchableOpacity style={{ alignItems: "center" }}>
                    <Image source={{ uri: avatar }} style={styles.avatarImage} resizeMode="contain" />
                </TouchableOpacity>
            </View>
            <Input placeholder="Enter Name" value={name} onChangeText={(text) => setName(text)} />
            <Input placeholder="Enter Email" value={email} onChangeText={(text) => setEmail(text)} />
            <Input placeholder="Enter Phone Number" keyboardType={'number-pad'} value={phoneNumber} onChangeText={(text) => setPhoneNumber(text)} />
            <Input placeholder="Enter Password" value={password} onChangeText={(text) => setPassword(text)} />
            <Input placeholder="Confirm Password" value={confirmPassword} onChangeText={(text) => setConfirmPassword(text)} />
            <Buttons title='continue' />
            <View style={styles.loginContainer}>
                <Text style={styles.loginText}>Already have an account?</Text>
                <TouchableOpacity onPress={() => props.navigation.navigate('Login')}>
                    <Text style={styles.loginLink}> Login</Text>
                </TouchableOpacity>
            </View>
        </View>
    );
};

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: 'white',
    },
    title: {
        fontSize: 30,
        color: 'black',
        alignSelf: 'center',
        marginTop: 80,
        marginBottom: 50
    },
    backgroundImage: {
        position: 'absolute',
        top: 0,
        left: 0,
        right: 0,
        
    },
    avatarImage: {
        width: 100,
        height: 100,
    },
    loginContainer: {
        flexDirection: 'row',
        marginTop: 30,
        marginLeft: '25%',
        fontSize: 15,
    },
    loginText: {
        color: 'black',
    },
    loginLink: {
        color: '#1B9CA9',
    }
});

export default Signup;
